d\nGraphics Coprocessor:Apple Integrated Graphics","domain":"amzn.to","promoted_is_removable":false,"rich_summary":{"site_name":"amzn.to","favicon_link":"https://s.pinimg.com/images/default_rich_pin_favicon.png","apple_touch_icon_images":null,"favicon_images":{"orig":"https://s.pinimg.com/images/default_rich_pin_favicon.png"},"type":"richpingriddata","url":"https://amzn.to/46r7mDE","display_name":"","id":"1c7ec6e808e857df8a29f54d238f094e","apple_touch_icon_link":null,"display_description":"SUPERCHARGED BY M3 — With an 8-core CPU and 10-core GPU, the Apple M3 chip can help you blaze through everyday multitasking and take on pro projects like editing thousands of photos or 4K video. BUILT FOR APPLE INTELLIGENCE — Apple Intelligence helps you write, express yourself, and get things done effortlessly. It draws on your personal context while setting a brand-new standard for privacy in AI. Coming in beta this fall. UP TO 22 HOURS OF BATTERY LIFE — Go all day thanks to the power-efficient design of Apple silicon. The MacBook Pro laptop delivers the same exceptional performance whether it’s running on battery or plugged in. (Battery life varies by use and configuration. See apple.com/batteries for more information.) BRILLIANT PRO DISPLAY — The 14.2-inch Liquid Retina XDR display features Extreme Dynamic Range, 1000 nits of sustained brightness for stunning HDR content, up to 600 nits of brightness for SDR content, and pro reference modes for doing your best work on the go. (The display has rounded corners at the top. (Measured diagonally, the screen is 14.2 inches. Actual viewable area is less.) FULLY COMPATIBLE — All your pro apps run lightning fast — including Adobe Creative Cloud, Apple Xcode, Microsoft 365, Medivis SurgicalAR, and many of your favorite iPhone and iPad apps. And with macOS, work and play on your Mac are even more powerful. Elevate your presence on video calls. Access information in all-new ways. And discover even more ways to personalize your Mac. ADVANCED CAMERA AND AUDIO — Look sharp and sound great with a 1080p FaceTime HD camera, a studio-quality three-mic array, and a six-speaker sound system with Spatial Audio. CONNECT IT ALL — This MacBook Pro features a MagSafe charging port, two Thunderbolt / USB 4 ports, an SDXC card slot, an HDMI port, and a headphone jack. Enjoy fast wireless connectivity with Wi-Fi 6E (in countries and regions where 6E is supported) and Bluetooth 5.3. Supports one external display. ADVANCED SECURITY — Every Mac comes with industry‑leading encryption, robust virus protections, and a powerful firewall system. And free security updates help keep your Mac protected. WORKS WITH ALL YOUR APPLE DEVICES — You can do amazing things when you use your Apple devices together. Copy something on iPhone and paste it on MacBook Pro. Use your MacBook Pro to answer FaceTime calls or send texts with Messages. And that’s just the beginning. BUILT TO LAST — The all-aluminum unibody enclosure is exceptionally durable. Free software updates keep things running smoothly for years to come.","actions":[],"type_name":"classifier data","products":[]},"tracking_params":"CwABAAAAEDU5NTAxMDUzNTQ2NjgzMDkGAAMACAsABwAAAApuZ2FwaS9wcm9kAA","is_eligible_for_web_closeup":false,"link":"https://amzn.to/46r7mDE","story_pin_data_id":null,"images":{"170x":{"width":236,"height":141,"url":"https://i.pinimg.com/236x/a7/73/20/a773205881a74ab1a29087eab1a851ff.jpg"},"236x":{"width":236,"height":141,"url":"https://i.pinimg.com/236x/a7/73/20/a773205881a74ab1a29087eab1a851ff.jpg"},"474x":{"width":474,"height":283,"url":"https://i.pinimg.com/474x/a7/73/20/a773205881a74ab1a29087eab1a851ff.jpg"},"736x":{"width":522,"height":312,"url":"https://i.pinimg.com/736x/a7/73/20/a773205881a74ab1a29087eab1a851ff.jpg"},"orig":{"width":522,"height":312,"url":"https://i.pinimg.com/originals/a7/73/20/a773205881a74ab1a29087eab1a851ff.jpg"}},"should_open_in_stream":false},"341640321749925195":{"node_id":"UGluOjM0MTY0MDMyMTc0OTkyNTE5NQ==","is_downstream_pro es by use and configuration. See apple.com/batteries for more information.) BRILLIANT PRO DISPLAY — The 14.2-inch Liquid Retina XDR display features Extreme Dynamic Range, 1000 nits of sustained brightness for stunning HDR content, up to 600 nits of brightness for SDR content, and pro reference modes for doing your best work on the go. (The display has rounded corners at the top. (Measured diagonally, the screen is 14.2 inches. Actual viewable area is less.) FULLY COMPATIBLE — All your pro apps run lightning fast — including Adobe Creative Cloud, Apple Xcode, Microsoft 365, Medivis SurgicalAR, and many of your favorite iPhone and iPad apps. And with macOS, work and play on your Mac are even more powerful. Elevate your presence on video calls. Access information in all-new ways. And discover even more ways to personalize your Mac. ADVANCED CAMERA AND AUDIO — Look sharp and sound great with a 1080p FaceTime HD camera, a studio-quality three-mic array, and a six-speaker sound system with Spatial Audio. CONNECT IT ALL — This MacBook Pro features a MagSafe charging port, two Thunderbolt / USB 4 ports, an SDXC card slot, an HDMI port, and a headphone jack. Enjoy fast wireless connectivity with Wi-Fi 6E (in countries and regions where 6E is supported) and Bluetooth 5.3. Supports one external display. ADVANCED SECURITY — Every Mac comes with industry‑leading encryption, robust virus protections, and a powerful firewall system. And free security updates help keep your Mac protected. WORKS WITH ALL YOUR APPLE DEVICES — You can do amazing things when you use your Apple devices together. Copy something on iPhone and paste it on MacBook Pro. Use your MacBook Pro to answer FaceTime calls or send texts with Messages. And that’s just the beginning. BUILT TO LAST — The all-aluminum unibody enclosure is exceptionally durable. Free software updates keep things running smoothly for years to come.","actions":[],"type_name":"classifier data","products":[]},"tracking_params":"CwABAAAAEDU5
